function Navbar(){
    return (
    <header>
      <nav>
        <div>
          <h1>
            <a href="https://github.com/p000059">
              <GitHubIcon />
              <p>/P000059</p>
            </a>
          </h1>
        </div>
      </nav>
    </header>
    );
}

export default Navbar;
